import React , { Component } from 'react';
import { DragDropContext } from 'react-beautiful-dnd';
import { Row, ListGroup, Col, Image, Container } from 'react-bootstrap';

const pizzaCrust = {
    width: '400px'
}

const dragImgStyle = {
    width: '100px'
}

export default class DndPizza extends Component {
    onDragEnd = result => {

    }
    render() {
        return(
            <>
                <DragDropContext onDragEnd={this.onDragEnd}>
                    <Row>
                    <Image src={require("../../images/pizza_crust.png")} style={pizzaCrust} rounded />
                        
                    <ListGroup style={{display: 'inline-block'}}>
                    <ListGroup.Item>
                        <Image src={require("../../images/mushroom.png")} style={dragImgStyle} rounded />
                    </ListGroup.Item>
                    <ListGroup.Item>
                        <Image src={require("../../images/pepperoni.png")} style={dragImgStyle} rounded />
                    </ListGroup.Item>
                    </ListGroup>
                    </Row>
                            
                </DragDropContext>
            </>
        )
    }
}
